  return (
    <div className="page">
      <meta charSet="UTF-8" />
      <meta name="viewport" content="width=device-width, initial-scale=1.0" />
      <title>Место</title>
      <Header/>

      <Main/>

      <Footer/>
    </div>
  );
}

export default App;
